@StetinaEP Drtiva porazka je drtiva porazka.

Byla to hloupa strategie pro evropske volby. Asi ne tak spatna strategie pro budouci kandidaturu do Senatu ci nejake ty prezidentske volby.

Prijde mi ale, ze Vas i @Telicka by bylo vic potreba prave v EP, protoze odborniku na EU mame minimum.
